    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Rappahannock River Valley NWR for the next 15
    years. This plan outlines the Refuge vision and purpose and describes how Rappahannock
    River Valley NWR will contribute to the overall mission of the Refuge System. The
    plan provides an introduction to the Refuge, an overview of the CCP process, information
    about the environment, information about the management direction, strategies for
    implementation, and consultation with others. Key planning issues include: wildlife
    management, habitat management, public use, and land protection.",nt"owner_org":
